// SPDX-License-Identifier: Unlicensed
pragma solidity >=0.5.0;
pragma experimental ABIEncoderV2;

import "../open/utils/Initializable.sol";
import "../open/utils/Ownable.sol";
import "../nftLib/FishNftFactory.sol";
import "../nftLib/FishPart.sol";



contract Nadmin is Initializable,Ownable{

    mapping(address => address) public nft1155Factorys;

    mapping(address => address) public nft721Factorys;

    constructor() public {}

    function initialize(
        address _ownerAddress
    ) public initializer {
        _owner = _ownerAddress;
    }

    function set1155NftAndFactory(address[] memory nfts,address[] memory factorys)external onlyOwner{
        require(nfts.length == factorys.length);

        uint len = nfts.length;

        for( uint i = 0; i < len; i++){
            nft1155Factorys[nfts[i]] = factorys[i];
        }
    }

    function set721NftAndFactory(address nft,address factory)external onlyOwner{
        nft721Factorys[nft] = factory;
    }

    function send1155Nft(address factory,address owner,uint level,uint amount)external onlyOwner{
        Nft1155Factory(factory).mint(owner, level, amount);
    }

    function send721Nft(address factory,address owner,uint level)external onlyOwner{
        FishNftFactory(factory).mint(owner, level);
    }

    function getFishFryInfo(address nft,uint level)external view returns(FishPart.FishFryConfig memory){
        return FishFryNftFactory(nft1155Factorys[nft]).getConfig(level);
    }

    function getFishFoodInfo(address nft,uint level)external view returns(FishPart.FoodConfig memory){
        return FoodNftFactory(nft1155Factorys[nft]).getConfig(level);
    }

    function getFishSpaceInfo(address nft,uint level)external view returns(FishPart.SpaceConfig memory){
        return SpaceNftFactory(nft1155Factorys[nft]).getConfig(level);
    }

    function getFishOxygenInfo(address nft,uint level)external view returns(FishPart.OxygenConfig memory){
        return OxygenNftFactory(nft1155Factorys[nft]).getConfig(level);
    }

    function get721NftInfo(address nft,uint[] memory ids)external view returns(uint[] memory levels,uint[] memory powers) {
        return FishNftFactory(nft721Factorys[nft]).getConfig(ids);
    }

    function get1155Types(address nft)external view returns(uint[] memory){
        return NftFactory(nft1155Factorys[nft]).getTypes();
    }

    function get721Types(address nft)external view returns(uint[] memory){
        return NftFactory(nft721Factorys[nft]).getTypes();
    }
}
